// mode numbers for IRQ, SVC, enavle and KEYS 
// interupt code taken from documents 
int SVC_MODE = 0b10011;
//int INT_DISABLE = 0b10000000;
//int INT_ENABLE = 0;
int IRQ_MODE = 0b10010;
int ENABLE = 1;
int KEYS_IRQ = 73;

void enable_A9_interrupts(void)
{
	// number 0b01010011 is taken from the example provided in documents
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

void set_A9_IRQ_stack(void)
{
	int stack, mode;
	stack = A9_ONCHIP_END - 7; // top of A9 onchip memory, aligned to 8 bytes
	/* change processor to IRQ mode with interrupts disabled */
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
	/* set banked stack pointer */
	asm("mov sp, %[ps]" : : [ps] "r"(stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

void config_GIC(void)
{
	config_interrupt (73, 1); // configure the KEYs parallel port (Interrupt ID = 73)
	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all priorities
	*((int *) 0xFFFEC104) = 0xFFFF;
	// Set CPU Interface Control Register (ICCICR). Enable signaling of interrupts
	*((int *) 0xFFFEC100) = 1;
	// Configure the Distributor Control Register (ICDDCR) to send pending interrupts to CPUs
	*((int *) 0xFFFED000) = 1;
}
/*
* Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target Registers (ICDIPTRn).
* The default (reset) values are used for other registers in the GIC.
*/
// copied directly from the document, not required by professor to understand  
void config_interrupt (int L, int CPU_target)
{
	int reg_offset, index, value, address;
	/* Configure the Interrupt Set-Enable Registers (ICDISERn).
	* reg_offset = (integer_div(N / 32) * 4
	* value = 1 << (N mod 32) */
	reg_offset = (L >> 3) & 0xFFFFFFFC;
	index = L & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
	/* Now that we know the register address and value, set the appropriate bit */
	*(int *)address |= value;
	/* Configure the Interrupt Processor Targets Register (ICDIPTRn)
	* reg_offset = integer_div(N / 4) * 4
	* index = N mod 4 */
	reg_offset = (L & 0xFFFFFFFC);
	index = L & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	/* Now that we know the register address and value, write to (only) the appropriate byte */
	*(char *)address = (char) CPU_target;
}

void __attribute__((interrupt)) __cs3_isr_irq(void)
{
	// Read the ICCIAR from the processor interface
	int address = MPCORE_GIC_CPUIF + ICCIAR;
	int int_ID = *((int *)address);
	if (int_ID == KEYS_IRQ) { // check if interrupt is from the KEYs
		pushbutton_ISR();
	}
	else
	while (1)
	; // if unexpected, then stay here
	// Write to the End of Interrupt Register (ICCEOIR)
	address = MPCORE_GIC_CPUIF + ICCEOIR;
	*((int *)address) = int_ID;
	return;
}
// do something when button is pressed
void pushbutton_ISR(void)
{
	volatile int * KEY_ptr = (int *)KEY_BASE;
	int press;
	press = *(KEY_ptr + 3); // read the pushbutton interrupt register
	*(KEY_ptr + 3) = press; // Clear the interrupt
	// changing game states based 
	if(game_state == INTRO) {
		game_state=JUMP;
	}
	else if (game_state == JUMP && gameOver == false) {
		jump();
	}
	if (gameOver){
		alive = true;
	   	clear_character();
		loopNumber = 0;
		gameOver = false;
	}
	return;
}

