//Update x-coordinate for spikes
void update_position_spikes(int *spike_x, int speed, bool isvisible[]){
	*spike_x= *spike_x - speed;
	if (*spike_x < 0) {
		(*spike_x) = START_OBSTACLE;
		isvisible[2] = false;
	}
}

//Draw ground with a white line for clarity
void draw_ground(){         //Ground starts at (199,239)
	for (int x = 0; x <= X_COOR_RIGHT_EDGE; x ++){
		for (int y = Y_COOR_GROUND; y <= 239; y ++){
			plot_pixel(x,y,0x0076);
			plot_pixel(x,Y_COOR_GROUND,0xFFFF);
		}
	}
}

//Drawing the whole background until the ground
void draw_background(){
	for (int x = 0; x<=X_COOR_RIGHT_EDGE;x++){
		for (int y = 0; y<Y_COOR_GROUND; y++){
			plot_pixel(x,y,0x443E);
		}
	}	
}

void draw(){
	memset((short int*) pixel_buffer_start, 0, 245760 );
	draw_ground();
}

//Drawing a square
void draw_square(int x, int y, short int line_color){
	plot_pixel(x-1,y-1,line_color);
	plot_pixel(x  ,y-1,line_color);
	plot_pixel(x+1,y-1,line_color);
	plot_pixel(x-1,y  ,line_color);
	plot_pixel(x  ,y  ,line_color);
	plot_pixel(x+1,y  ,line_color);
	plot_pixel(x-1,y+1,line_color);
	plot_pixel(x  ,y+1,line_color);
	plot_pixel(x+1,y+1,line_color);
}

//Clear screen for triangle
void clear_screen_for_triangle(int triangle_x, int triangle_y, int trianglesize, int erase_colour) {
	draw_square(triangle_x-1, triangle_y-1, erase_colour);
	draw_square(triangle_x-(trianglesize)/2, triangle_y-trianglesize, erase_colour);
	draw_square(triangle_x-trianglesize+1, triangle_y-1, erase_colour);
	draw_line(triangle_x-(trianglesize)/2, triangle_y-trianglesize, triangle_x-1,  triangle_y-1, erase_colour);
	draw_line(triangle_x-trianglesize+1, triangle_y-1, triangle_x-1, triangle_y-1,  erase_colour);
	draw_line(triangle_x-trianglesize+1, triangle_y-1, triangle_x-(trianglesize)/2, triangle_y-trianglesize, erase_colour);
}

//Draw line using Bresenhams algorithm
void draw_line(int x0, int y0, int x1, int y1, short int line_colour) {
	bool is_steep;
	int x;
	int b;
	is_steep = (abs(y1 -y0)) > (abs(x1-x0));
	if (is_steep){
	 	int a = x0;
	    x0 = y0;
	    y0 = a;
	
	    a = x1;
	    x1 = y1;
	    y1 = a;
	}
	if (x0 > x1){
	 	b = x0;
	    x0 = x1;
	    x1 = b;
	    b = y0;
	    y0 = y1;
	    y1 = b;
	}
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2 );
	int y = y0;
	int y_step;
	if (y0 < y1){
		y_step = 1;
	}
	else{
		y_step = -1;
	}
	for (x=x0; x<=x1; x++) {
		if(is_steep) {
			plot_pixel(y,x, line_colour); // now x and y is switched
		}
		else {
			plot_pixel(x,y, line_colour);
		}
		error = error + deltay;
		if (error >= 0) {
			y = y + y_step;
			error = error - deltax;
		}
	}
}

//Plot a single pixel a specific colour
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void wait_for_vsync() {
	volatile int * pixel_ctrl_ptr = 0xFF203020; //pixel controller
	register int status;
	*pixel_ctrl_ptr =1;
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr +3 );
	}
}
	
